import React from "react";
import styles from "./Table.module.css";

export default function Table(props) {
  return (
    <div>
      <table className={styles.result}>
        <thead>
          <tr>
            <th>Year</th>
            <th>Total Savings</th>
            <th>Interest (Year)</th>
            <th>Total Interest</th>
            <th>Invested Capital</th>
          </tr>
        </thead>
        <tbody>
          {props.data.map((list) => (
            <tr>
              <td>{list.year}</td>
              <td>{list.savingsEndOfYear}</td>
              <td>{list.yearlyInterest}</td>
              <td>{list.savingsEndOfYear - props.initialInvestment - list.yearlyContribution * list.year}</td>
              <td>{list.initialInvestment + list.yearlyContribution * list.year}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
